import React from 'react'
import NoteBook from './Notebook'

const Home = (props) => {

    const {userLoggeIn} = props

    const handleCopy = (e) => {
        navigator.clipboard.writeText(e.target.value)
    }

    return (
        <div>
            {userLoggeIn ? 
            (
            <NoteBook/>
            )
            :
            (
                <div>
                    <div >
                    <h2>Login or Create Account to Add/Manage notes</h2>
                    </div>
                    <h3>Credentials</h3>
                    <p>Email - dct6543@gmail.com <button value="dct6543@gmail.com" onClick={handleCopy}>Copy</button></p>
                    <p>secret123</p>
                </div>
            )
            }
        </div>
    )
}

export default Home
